أكد سعادة محمد الشامسي مدير الإدارة الأفريقية بوزارة الخارجية والتعاون الدولي أن دولة الإمارات ستقدم العلاج الطبي لإبراهيم أبوبكر كيتا رئيس مالي السابق.
وقال سعادته في تصريح له إن ذلك يأتي استجابة لطلب المجلس العسكري الحاكم في مالي وبالتشاور مع فخامة الرئيس محمدو يوسفو رئيس جمهورية النيجر والرئيس الحالي للمجموعة الاقتصادية لدول غرب أفريقيا والاتحاد الأفريقي.
وأكد الشامسي أن دولة الإمارات تؤمن بأهمية عودة الاستقرار إلى مالي وتنفيذ عملية سياسية سريعة وبناءة لضمان أفضل النتائج للشعب المالي الشقيق، ومنطقة الساحل.

